import { Card, CardHeader, IconButton } from '@mui/material'
import React from 'react'

export default function Category() {
  return (
    <Card>
      <CardHeader
        title={"Categories"}
        sx={{
          pt: 2, 
          alignItems: "center", 
          "& .MuiCardHeader-action": { mt: 0.6},
        }}
        action={
          <IconButton onClick={handleOpenCreateCategory}/>
        }
      />
    </Card>
  )
}
